<html>
<head>
    <style>
        body {
			background-color:#FFF;
			font-family: Arial, Helvetica, sans-serif;
			margin: 0px;
			padding: 0px;
        }

        h1 {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 21px;
            font-weight: bold;
            color: #154995;
            margin: 0px;
            padding-top: 15px;
            padding-bottom: 0px;
        }

        h2 {
			font-family: Arial, Helvetica, sans-serif;
			font-size: 15px;
			font-weight: bold;
			color: #154995;
			display: block;
			border-bottom-width: 1px;
			border-bottom-style: solid;
			border-bottom-color: #dddddd;
			padding-bottom: 3px;
			padding-top: 5px;
			margin: 0px;
        }

        table {
            -moz-box-sizing: border-box;
            box-sizing: border-box;
            -webkit-box-sizing:border-box;
        }

        table td {
            padding-top: 5px;
            padding-bottom: 5px;
        }

        .quote-info-wrapper {
			padding: 10px;
			border: 1px solid #000;
			margin-top: 0px;
			margin-bottom: 0px;
        }

        .arial-bold-black {

            font-family:Arial, Helvetica, sans-serif;
            font-weight:bold;
            color:#000;

        }

        .quote-details {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 13px;
            color: #333333;

        }
		
		.quote-details .ReplacementCostBuilding {
			font-size: 11px;
			font-style: italic;
		}

        .footer {
			font-family: Arial, Helvetica, sans-serif;
			font-size: 11px;
			color: #666666;
			padding-top: 10px;
        }


    </style>
</head>
<body>

<img width="100%" src="data:image/png;base64,"/>

<div class="quote-info-wrapper">
    <table width="100%" border="0" cellspacing="0" cellpadding="0">
        <tr>
            <td width="50%">
            	<span class="arial-bold-black" style="font-size:14px;">Your quote ID:</span> <span style="font-family:Arial, Helvetica, sans-serif; font-size:16px; font-weight:bold; color:#154995;"><!QuoteID!></span>
            </td>
            <td width="50%">
            	<span class="arial-bold-black" style="font-size:14px;">GEICO Insurance Agency</span>
            </td>
        </tr>
        <tr>
            <td>
            	<span class="arial-bold-black" style="font-size:15px;">Annual Premium:</span> <span style="font-family:Arial, Helvetica, sans-serif; font-size:22px; font-weight:bold; color:#ee6d00;"><!TotalPremium!></span>
            </td>
            <td>
            	<span class="arial-bold-black" style="font-size:22px;">Call @phonenumber@</span>
            </td>
        </tr>
        <tr>
            <td>
                <div class="arial-bold-black" style="font-size:13px;">Applicant Information: </div>
                <span style="font-family:Arial, Helvetica, sans-serif; font-size:13px; color:#000;">
                <!FullName!><br>
                <!Address1!><br>
               	<!Address2!>
                </span>
            </td>
            <td>
                <div class="arial-bold-black" style="font-size:13px;">Hours of Operation:</div>
                <span style="font-family:Arial, Helvetica, sans-serif; font-size:13px; color:#000;">
                Mon.-Fri. 7:30 AM - 1:00 AM ET<br>
                Sat. 8:00 AM - 10:30 PM ET<br>
                Sun. 8:00 AM - 10:30 PM ET
                </span>
            </td>
        </tr>
    </table>
</div>

<h1>Coverage Details</h1>

<div class="section-wrapper">

    <h2>Property Coverage</h2>

    <table class="quote-details" width="100%" border="0" cellspacing="0" cellpadding="0">
        <tr>
            <td width="50%">Dwelling <span class="ReplacementCostBuilding">(Est. Replacement Cost: <span class="value bold"><!ReplacementCostRounded!></span>)</span></td>
            <td width="50%"><!CoverageA!></td>
        </tr>
        <tr>
            <td>Other Structures</td>
            <td><!CoverageB!></td>
        </tr>
        <tr>
            <td>Personal Posessions</td>
            <td><!CoverageC!></td>
        </tr>
        <tr>
            <td>Loss of Use</td>
            <td><!CoverageD!></td>
        </tr>
        <tr>
            <td>Additional Limits of Insurance (on Dwelling)</td>
            <td><!AdditionalAmountsOfInsurance!></td>
        </tr>
        <tr>
            <td>Personal Property Loss Settlement</td>
            <td><!PersonalPropertyReplacementCost!></td>
        </tr>
    </table>

</div>

<h2>Liability Coverage</h2>

<table class="quote-details" width="100%" border="0" cellspacing="0" cellpadding="0">
    <tr>
        <td width="50%">Personal Liability</td>
        <td width="50%"><!CoverageE!></td>
    </tr>
    <tr>
        <td>Medical Payments to Others</td>
        <td><!CoverageF!></td>
    </tr>
    <tr>
        <td>Personal Injury</td>
        <td><!PersonalInjuryCoverage!></td>
    </tr>
</table>


<h2>Additional Coverage</h2>

<table class="quote-details" width="100%" border="0" cellspacing="0" cellpadding="0">
    <tr>
      <td width="50%">Identity Theft Expense Protection</td>
        <td width="50%"><!IdentityFraudCoverage!></td>
    </tr>
    <tr>
        <td>Mechanical Breakdown</td>
        <td><!MechanicalBreakdownCoverage!></td>
    </tr>
    <tr>
        <td>Earthquake Protection</td>
        <td><!EarthquakeCoverage!></td>
    </tr>
    <tr>
        <td>Jewelry Coverage</td>
        <td><!JewelrySpecialLimits!></td>
    </tr>
    <tr>
        <td>Water Backup and Sump PumpOverflow Coverage</td>
        <td><!WaterBackupCoverage!></td>
    </tr>
    <tr>
        <td>Loss Assessment</td>
      <td><!LossAssessmentCoverage!></td>
  </tr>
    <tr>
        <td>Law/Ordinance Coverage</td>
        <td><!IncreasedOrdinanceLimit!></td>
    </tr>
</table>


<h2>Deductibles</h2>

<table class="quote-details" width="100%" border="0" cellspacing="0" cellpadding="0">
    <tr>
        <td width="50%">Regular Loss</td>
        <td width="50%"><!AllOtherPerilsDeductible!></td>
    </tr>
</table>

<div class="footer">
    The annual premium quoted is an estimate based on the information you provided on the date prepared. The premium may change based on additional information obtained during the purchase process. This is not a contract or binder of coverage.
    <p>
        Occidental Fire & Casualty Company of North Carolina is rated A- "excellent," by A.M Best, the most widely recognized financial rating organization of the insurance industry. Occidental, an IAT Company, has over 50 years of experience and serves tens of thousands of customers across the United States.
</div>


</body>

</html>